import p1_img from "./product_1.jfif";
import p2_img from "./product_14.jfif";
import p3_img from "./product_22.jfif";
import p4_img from "./product_4.jfif";

let product_data = [
  {
    id: 1,
    name: "Samsung S24",
    image: p1_img,
    discounted_price: 999,
    original_price: 1300,
  },
  {
    id: 2,
    name: `Apple MacBook Air 13(M3 Chip) `,
    image: p2_img,
    discounted_price: 699,
    original_price: 999,
  },
  {
    id: 3,
    name: "Adidas Essentials Logo Hoodie",
    image: p3_img,
    discounted_price: 20,
    original_price: 50,
  },
  {
    id: 4,
    name: "Sony bravia A95L(XR-65A95L)",
    image: p4_img,
    discounted_price: 400,
    original_price: 500,
  },
];

export default product_data;
